import react from 'react';
import Link from 'next/Link';

//this is the landing page

class Index extends React.Component {

    render() {
        return (
            < div >
                <p>Hello Next.js</p>
                <p>This will be landing page</p>
                <Link href="/about">
                    <a>About Page</a>
                </Link>
            </div >
        )
    }
}

export default Index;
